  true,\n\t\"url\": null,\n\t\"notes\": \"<p>The Behavioral Risk Factor Surveillance
  System (BRFSS) is a state-based system of health surveys that collects information
  on health risk behaviors, preventive health practices, and health care access primarily
  related to chronic disease and injury. For many states, the BRFSS is the only available
  source of timely, accurate data on health-related behaviors.</p>n\",\n\t\"license_title\":
